import User from "./User"

const Users = (props) => {

  if (props.users.length > 0){
    return(<div>
      {props.users.map((el) => (
      <User user={el} key={el.id} />
      ))}

    </div>)
  }
  else{
    return(<div className="user">
      <h2>Нет пользователей</h2>
    </div>)
  }

}

export default Users
